import React from "react";
import "../page/style/PostDoor.css";

function PostDoor() {
  return (
    <div className="PostDoor">
      <div className="name">자유개시판</div>
      <div className="post1">post1 포스트1</div>
      <div className="post2">post2 포스트2</div>
      <div className="post3">post3 포스트3</div>
      <div className="post4">post4 포스트4</div>
    </div>
  );
}

export default PostDoor;
